import { Injectable } from '@angular/core';
import {Store} from '@ngrx/store';
import {SetWorkers} from '../store/workers.actions';
import {Worker} from '../models/worker';

@Injectable({
  providedIn: 'root'
})
export class DataReceiverService {

  constructor(private store: Store<{workers: Worker[]}>) {
    this.getData();
  }

  getData() {
    // cycle
    // get data
    let workers: Worker[] = Workers;
    // add to store
    this.store.dispatch(new SetWorkers({workers}));
  }
}

const Workers: Worker[] = [
  new Worker(1, 'a'),
  new Worker(2, 'b'),
  new Worker(3, 'c'),
  new Worker(4, 'd'),
  new Worker(5, 'e')
];
